DataPoints = JaimeDataPoints;
function spinData(frequency, data) {

    let ret = data.slice();

    for (let i = 0; i < data.length; i++) {
        let pol = toPolar(data[i]);
        pol.a /= (2 * Math.PI);

        pol.a += frequency * (i / data.length)

        pol.a *= (2 * Math.PI);

        let car = toCartesian(pol);

        ret[i] = car;
    }
    return ret;
}

function toPolar(point) {
    return { "a": Math.atan2(point.y, point.x), "m": Math.sqrt(point.x * point.x + point.y * point.y) }
}

function toCartesian(point) {
    return { "x": Math.sin(point.a) * point.m, "y": Math.cos(point.a) * point.m };
}

function findCenterOfMass(data) {
    let retX = 0;
    let retY = 0;

    for (let i = 0; i < data.length; i++) {
        retX += data[i].x;
        retY += data[i].y;
    }

    retX /= data.length;
    retY /= data.length;

    console.log(retX, retY)
    return { "x": retX, "y": retY };

}

function analize(range_) {
    let range = [-range_, range_];

    let negativeOffset = range[0];

    let iterations = range[1] - range[0] + 1;

    let outputM = [];
    let outputA = [];

    for (let i = 0; i < iterations; i++) {
        let freq = i + negativeOffset;

        let tmp = toPolar(findCenterOfMass(spinData(freq, DataPoints)));

        outputM.push(tmp.m);
        outputA.push(tmp.a)
    }

    console.log("let dataM = " + JSON.stringify(outputM) + " \nlet dataA = " + JSON.stringify(outputA));

    return [outputM, outputA];

}

